import React, { useState, useEffect, Suspense } from 'react';
import { getFetchCall } from '../api/fetchFunc';
import NoData from '../noData/Index';

const CarDescription = (props) => {
  const [modelName, setBrand] = useState([]);
  const [modelState, setProfileState] = useState(props);
  const food = '';
  useEffect(() => {
  const abc =  getFetchCall('http://uimocks.infoedge.com/vehicles.json').then(res => {       
      setBrand(res) 
    },[]);
    setProfileState(props);
     food = abc.read();
     console.log(food)
  },[props]);

  return (
    <React.Fragment>
      <Suspense>
       {food.some(el => el.model == modelState.models) == true ? 
      <div className='cardWrap'>
        {food.map((food, index) => (
          ((modelState.models == food.model)) && <div
            key={index}
            className={'featureCard'}
          >
            <div><b>Brand: </b>{food.make}</div>
            <div><b>Model: </b> {food.model}</div>
            <div><b>Engine Power(ps): </b>{food.enginePowerPS}</div>
            <div><b>Engine Power(kw): </b>{food.enginePowerKW}</div>
            <div><b>Fuel Type: </b>{food.fuelType}</div>
            <div><b>Body Type: </b>{food.bodyType}</div>
            <div><b>Engine Capacity: </b>{food.engineCapacity}</div>
          </div>
        ))}
      </div> : <NoData/> }
      </Suspense>
    </React.Fragment>
  )
}

export default CarDescription;
